        0x02    0x60         0x600e      PUSH1 14            14 size size
        0x03    0x60         0x6000      PUSH1 00            0 14 size size
        0x04    0x39         0x39        CODECOPY            size
        0x05    0x60         0x6000      PUSH1 00            0 size
        0x06    0xf3         0xf3        RETURN
